import React, {useState} from 'react';
import './App.css';

const Header = () => {
    return(
       <div className="header">
            <h1>Hello I'm a doc builder!</h1>

       </div>
    );
};
const Login = () => {
    return(
       <div className="login">Hello me login</div>
    );
};
const Sidebar = () => {
    return(
       <div className="sidebar">
            Hello me sidebar<br/>
            Hello me sidebar<br/>
            Hello me sidebar
       </div>
    );
};
const Content = () => {
    return(
       <div className="content">Hello me content</div>
    );
};

const Nav = () => {
    return(
       <div className="nav">Hello me nav</div>
    );
};

export default function App() {
  return (
    <div className='wrapper'>
        <Header />
        <Login />
        <Sidebar />
        <Nav />
        <Content />
    </div>
  );
}
